import React from 'react';
import './Card.css';

const Card = (props) => {



    return (

        <div className="wrapper">
            <table>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Full Name</th>
                        <th>Enrollment Date</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{props.id}</td><td>{props.name}</td><td>{props.date}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
};

export default Card;
